CREATE VIEW [dbo].[Wages_View]
AS
SELECT  dbo.Wages_Records.WR_id, dbo.Wages_Records.Staff_id, dbo.Staff.Staff_Name, dbo.Store.Store_Name, 
                   dbo.Grade.GradeName, dbo.Grade.Grade_price, dbo.Wages_Records.SubsidyAmount, dbo.Wages_Records.WR_Bonus, 
                   dbo.Wages_Records.Deduction, dbo.Wages_Records.WR_Pay, dbo.Wages_Records.Real_Wage, 
